package crypto;

import java.security.NoSuchProviderException;
import org.bouncycastle.crypto.*;
import org.bouncycastle.crypto.engines.AESEngine;
import org.bouncycastle.crypto.macs.CMac;
import org.bouncycastle.crypto.params.*;
import org.bouncycastle.util.encoders.Hex;

public class CMAC_AES_gen {
	
	public static void main(String[] args) throws NoSuchProviderException {
		/*
		String 	Key     = args[0];
		String 	Msg  	= args[1];
		*/
		
		String 	Key     = "b75a7b2b53e40a3932675dec5f566e60";
		String 	Msg  	= "";

		byte[] Key_byte = Hex.decode(Key);
		byte[] Msg_byte = Hex.decode(Msg);
		
		byte[] result = new byte[16];
		
		CipherParameters params = new KeyParameter(Key_byte);	// set key 
	    	BlockCipher aes = new AESEngine();			//
	    	CMac mac = new CMac(aes, 128);				//
	    
		mac.init(params);
		mac.update(Msg_byte, 0, Msg_byte.length);
		mac.doFinal(result, 0);
	    
	    	String cmac_aes = new String(Hex.encode(result));
	    
	    	System.out.println("KEY: " + Key);
	    	System.out.println("MSG: " + Msg);
	    	System.out.println("CMAC:" + cmac_aes);
	    	System.out.println("");
	}

}
